Neon Zebra - Turn off the Sun (Promo)

Error Chi7d and Mizimo are two outstanding electronic music producers and well known in the underground dance scene.Together they created Neon Zebra, a dark Trip Hop Project.Error Chi7d (Salvatore Thelen) makes the powerfull music.Mizimo (Yasmin Brook) is the powerful singer.Direct from the streets into your hearts.Here is Neon Zebra

